webpackJsonp([0xbecca7250b9d],{1565:function(e,a){e.exports={data:{markdownRemark:{html:'<p>이른 아침 "Reading"잡지를 읽는 중에 영화에 대한 해설 인 "You can not accept"와 같은 기사가 있습니다. 이 영화는 베이징 하이브리드 (Beijing Hybrid)라고 불리며 "여섯 번째 세대 감독 (The Sixth Generation Director)"의 걸작으로 불리우며 말도없고 이야기가없고 음모가없는 사람도있다. 국내에서이 영화는 공개되지 않았으며 해외에서 많은 주목을 받고 국제 영화제에 초청 된 것으로 알려져 있습니다. 외국인이 여기에 더 흥미를 느낄수록 자신이 더 독특하고 공무원이 더 많이 인식하지 못하기 때문에 가치가 있다고 생각하면할수록 농담을 덜합니다.</p>\n<p>"The Lion City Apocalypse Revelation"에 기사를 썼으며 논리적 능력과 가치 능력에 대한 교육을 썼습니다. 논리 능력은 훈련 과정에 힘을 쏟았으며 쉽게 진전 할 수없는 가장 기술적 인 부분입니다. 가치 능력은 한 번에 훈련 할 수있는 것이 아니며, 그 때 훈련은 기본적인 가치를 제공하고 조금 실용적이었습니다. 이후 수비수들이 얼마나 많은 돈을 받았는지에 달려 있습니다. 논리적 능력은 논쟁에서 가장 기본적인 능력이며, 다른 모든 능력과 논리 능력은 밀접하게 관련되어 있습니다. 많은 사람들이 논쟁하는 기술에 대해 많은 논의를하지만, 논리적 능력의 중요성과 근본적인 중요성을 인식하지 못하기 때문에 훌륭한 토론자가 될 수 없습니다.</p>\n<p>그는 저녁 10시 30 분에 집으로 돌아와서 "교토 크로니클"의 후반부를 텔레비전에 올렸다. 전반이 끝난 후, 반응은 좋지 않았다. 첫 번째는 너무 많은 "부드러운 광고"가 있다는 것입니다. 우리는 몇 분을 봐야합니다. 우리가 볼 때마다 자연스럽고 지루해 야합니다. 둘째, 극적 인 모순과 갈등은 너무 인공적입니다. 만날 때나 말다툼 할 때 인간의 손길이 보이지 않습니다. 좋은 사람이없는 것 같습니다. 셋째, 드라마 분쟁은 너무 형식화되어 있으며 삶과 분리되어 있습니다. 그것은 완전히 개념적 갈등입니다. 나는 후반부를 쏘고, 기다리고, 볼 방법을 모른다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0012.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0012.md",frontmatter:{title:"1월 19일 수요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0012.md absPath of file >>> MarkdownRemark"}}}});
